lens_4.query:
q = load "Load_opty_services_acct_all";
{{cell(OptyRoleToggle_1.selection, 0, "saql_filter").asString()}}"{{cell(UserData.selection, 0, "Name").asString()}}";
q = filter q by 'OpportunityServices__c.StageName' == "Closed Won";
q = foreach q generate 'OpportunityServices__c.Id' as 'Id', 'OpportunityServices__c.Name' as 'name', 
'OpportunityServices__c.gCRM_Source_Creation_Date__c' as 'Created', 'Actual_Close_Year'+":"+'Actual_Close_Month'+":"+'Actual_Close_Day' as 'closeDate', 
daysBetween( toDate(((('OpportunityServices__c.gCRM_Source_Creation_Date__c_Year' + ":") + 'OpportunityServices__c.gCRM_Source_Creation_Date__c_Month' + ":") 
+ 'OpportunityServices__c.gCRM_Source_Creation_Date__c_Day'), "yyyy:MM:dd"), toDate(((('Actual_Close_Year' + ":") + 'Actual_Close_Month' + ":") 
+ 'Actual_Close_Day'), "yyyy:MM:dd")) as 'DaysToClose', count() as 'count';
q = group q by all ;
q = foreach q generate round(average(DaysToClose)) as CY_Days; 
q = limit q 2000;
